import React from 'react';
import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <div className='container' >
      <h1> Basthi Ki Pathshala Organization</h1>
      <img src='/images/Basti-Ki-Pathashala-Official-Logo'/>
      <Link to="/register">Register</Link> | <Link to="/admin">Admin Login</Link>
    </div>
  );
}
